import React from 'react'

styles = {
    form: {
        marginBottom: '20px',
    },

    input: {
        width: '400px',
        height: '50px',
        borderRadius: '10px',
        border: '1px solid gray'
    }
}

function AddTodo() {
    return(
        <form style={styles.form}>
            <input type="text" />
            <button type="submit">Add new task!</button>
        </form>
    )
}

export default AddTodo
